	  244492,NULL,13755,85,1990,
	  "2.50 USD; 3.00 CAD",68.000,NULL,"Adaptation of the NBC-TV movie that aired on May 6 1990. Based on the teleplay by Evan Katz.  Story has many flashback sequences and features two styles of art: the adult years done in realistic style by Gene Colan and the flashbacks done in \"Archie\" style by Stan Goldberg and Mike Esposito.  This is a similar approach to the way the art was done in the \"Archie Meets Punisher\" cross-over. This is a more sophisticated Archie book and the styles work well together. Features no advertisements except on the back cover. Additional index information by Gregg Whitmore.",
	  NULL,NULL,07189646961501,NULL,1990,"Approved by the Comics Code Authority"
