	  247346,"1",14121,2,2005,
	  "2.99 USD; 4.00 CAD",36.000,"monthly","Two covers were initially done for this issue; one by Churchill/Rapmund featuring Supergirl and Power Girl and an alternate one by Turner featuring just Supergirl (75/25 percent mixture).  There also was a second printing with a third cover the Turner cover with just pencils.  There also was a third printing with a fourth cover by Churchill featuring Batman and Supergirl a new one inspired by the classic cover of Action Comics #252.  Second printing went on sale 2005-09-07 (non-US) and 2005-09-08 (US). Third printing went on sale 2005-10-05.",
	  NULL,NULL,76194124904900111,NULL,2005,"Approved by the Comics Code Authority"
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  247347,"2",14121,2,2005,
	  "2.99 USD; 4.00 CAD",44.000,"monthly","Two covers were initially done for this issue; one by Churchill/Rapmund featuring Supergirl and the Teen Titans and an alternate one by Turner featuring just Supergirl (50/50 percent mixture).",
