	  247349,"4",14121,2,2006,
	  "2.99 USD; 4.00 CAD",36.000,"monthly","Two covers were initially done for this issue; one by Churchill/Rapmund featuring Supergirl and members of the JLA and an alternate one by Churchill featuring Dark Supergirl and Lex Luthor (10 issues for 1 issue mixture).",
	  NULL,NULL,76194124904900411,NULL,2006,"Approved by the Comics Code Authority"
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  247350,"5",14121,2,2006,
	  "3.99 USD; 5.50 CAD",44.000,"monthly","Two covers were initially done for this issue; both by Ian Churchill and Michael Turner (50/50 percent mixture).  A second printing came out a month later.  This issue's content was originally solicited to be contained in issues #5 and #6 but with a combination of factors including the death of the author's son the overall lateness of the book and the desire to start the One Year Later storyline concurrent with the other DC titles the decision was made to combine those issues into #5 with an expanded page count.  This was announced via press release on 2006-02-07.",
